import { Row, Col } from "react-bootstrap";

const PhotoBanner = () => {
  return (
    <Row className="photo-banner">
      <Col>
        <div className="if-description">
          <h4></h4>
          <p></p>
        </div>
      </Col>
      <Col>
        <div className="photo">
          <img />
        </div>
      </Col>
    </Row>
  );
};

export default PhotoBanner;
